import React, {Component} from 'react';
import { Badge } from "react-bootstrap";



class Icons extends Component{
    render(){
        return(
            <Badge badgeContent={4}>
                <FaSocks style={{color:'white',fontSize:'2vw'}}/>
            </Badge>
        );
    }

}

export default Icons;
